package fi.oph.koski.todistus.swisscomclient

import fi.oph.koski.http.HttpStatus
import fi.oph.koski.log.Logging

class MockSwisscomClient(
  myConfig: SwisscomConfig
) extends SwisscomClient with Logging {
  val config = myConfig

  protected def requestSignature(req: SwisscomAISSignRequest): Either[HttpStatus, SwisscomAISSignResponse] = {
    Right(SwisscomAISSignResponse(SignResponse(
      `@RequestID` = req.SignRequest.`@RequestID`,
      `@Profile` = "http://ais.swisscom.ch/1.1",
      Result = SignResponseResult(
        ResultMajor = Some("urn:oasis:names:tc:dss:1.0:resultmajor:Success")
      ),
      OptionalOutputs = Some(OptionalOutputs(
        `sc.RevocationInformation` = Some(ScRevocationInformation(
          `sc.CRLs` = Some(ScCRLs(
            `sc.CRL` = List(""),
          )),
          `sc.OCSPs` = Some(ScOCSPs(
            `sc.OCSP` = List(""),
          ))
        ))
      )),
      SignatureObject = Some(SignatureObject(
        Base64Signature = Some(Base64Signature(
          `@Type` = Some("urn:ietf:rfc:3369"),
          `$` = Some("")
        ))
      ))
    )))
  }
}
